import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './index.css';
import reportWebVitals from './reportWebVitals';
import Home from './Pages/Home';
import Login from './Pages/Login';
import Signup from './Pages/Signup';
import CrewLists from './Pages/CrewLists';
import MyClub from './Pages/MyClub';
import SiteInfo from './Pages/SiteInfo';
import ClubMembers from './Pages/ClubMembers';
import MemberAccount from './Pages/MemberAccount';
import AddMember from './Pages/AddMember';
import AddInfo from './Pages/AddInfo';
import ComponentLibrary from './Pages/ComponentLibrary';
import clubMemberData from "./Assets/content/club.json";

// const numbers = [1, 2, 3, 4, 5];
// const doubled = numbers.map((number) => number);
// console.log(doubled);

for (let i = 0; i < clubMemberData.clubs.length; i++) {
  let arrayPath = clubMemberData.clubs[i].path;
  console.log(arrayPath);
}

const [showData, setShowData] = useState();

function pullJson() {
  fetch(clubMemberData)
  .then(repsonse => repsonse.json())
  .then(responseData => {
    let displayData = responseData.map(function(data) {
      return(
        <p>{data.path}</p>
      )
    })
  })
}

// const arrayPath = clubMemberData.clubs.map((i) => i);
// console.log(arrayPath);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
      <Route exact path='/' element={<Home />} />
      <Route index element={<Home />} />
      <Route path='/login' element={<Login />} />
      <Route path='/signup' element={<Signup />} />
      <Route path='/crew-lists' element={<CrewLists />} />
      <Route path='/my-club' element={<MyClub />} />
      <Route path='/site-information' element={<SiteInfo />} />
      <Route path={'/club-members/' + 'carnlough'} element={<ClubMembers />} />
      <Route path='/member-account' element={<MemberAccount />} />
      <Route path='/add-member' element={<AddMember />} />
      <Route path='/add-info' element={<AddInfo />} />
      <Route path='/component-library' element={<ComponentLibrary />} />
    </Routes>
  </BrowserRouter>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
